import React from 'react';
import { Link } from 'react-router-dom';
import styled from '@emotion/styled';


function NavBar(){
    const Nav = styled.nav`
        position: absolute;
        top: 0px;
        left: 0px;
        width: 100%;
        background-color: #212a31;
        height: 100px;
    `;
}

export default NavBar;
